import { useState } from "react"
import { makeRequest } from "../makeReques"

const useFetch=async (url)=>{
    const [data,setData]=useState(null)
    const [loading,setLoading]=useState(false)
    const [error,setError]=useState(false)
    
    useEffect(()=>{
        const fetchData=async ()=>{
           
            try{
                setLoading(true)
                const data1=await makeRequest.get(url,
                {
                    headers:
                    {
                        Authorization:'Bearer'+'22986f855ef1c5b312fa65377627c5a021c7c354732ad1362705b638d61ba43a6dda990576ae3eb91c7ebc3ab79288dd3c4e01e0f2ce0b4b1e063037bbb09cf894518d444999fe319ab88c2a95931348f8e705fd50e78b695066e9ed19d0319497a6dd3ff518fd4b1e35ce17695c141ff4c01a1f5e493161d73e70c5e3cab2e4',
                    },
                });
                setProducts(data1.data.data)
                console.log(data1);
            }catch(err){
                setError(true)
            }
            setLoading(false)
        }
        fetchData();
    },[url])
    return {data,loading,error}
}
export default useFetch();
